/*
 * @lc app=leetcode id=1937 lang=cpp
 *
 * [1937] Maximum Number of Points with Cost
 *
 * https://leetcode.com/problems/maximum-number-of-points-with-cost/description/
 *
 * algorithms
 * Medium (35.67%)
 * Likes:    2541
 * Dislikes: 165
 * Total Accepted:    74.2K
 * Total Submissions: 200.1K
 * Testcase Example:  '[[1,2,3],[1,5,1],[3,1,1]]'
 *
 * You are given an m x n integer matrix points (0-indexed). Starting with 0
 * points, you want to maximize the number of points you can get from the
 * matrix.
 *
 * To gain points, you must pick one cell in each row. Picking the cell at
 * coordinates (r, c) will add points[r][c] to your score.
 *
 * However, you will lose points if you pick a cell too far from the cell that
 * you picked in the previous row. For every two adjacent rows r and r + 1
 * (where 0 <= r < m - 1), picking cells at coordinates (r, c1) and (r + 1, c2)
 * will subtract abs(c1 - c2) from your score.
 *
 * Return the maximum number of points you can achieve.
 *
 * abs(x) is defined as:
 *
 *
 * x for x >= 0.
 * -x for x < 0.
 *
 *
 *
 * Example 1:
 *
 *
 * Input: points = [[1,2,3],[1,5,1],[3,1,1]]
 * Output: 9
 * Explanation:
 * The blue cells denote the optimal cells to pick, which have coordinates (0,
 * 2), (1, 1), and (2, 0).
 * You add 3 + 5 + 3 = 11 to your score.
 * However, you must subtract abs(2 - 1) + abs(1 - 0) = 2 from your score.
 * Your final score is 11 - 2 = 9.
 *
 *
 * Example 2:
 *
 *
 * Input: points = [[1,5],[2,3],[4,2]]
 * Output: 11
 * Explanation:
 * The blue cells denote the optimal cells to pick, which have coordinates (0,
 * 1), (1, 1), and (2, 0).
 * You add 5 + 3 + 4 = 12 to your score.
 * However, you must subtract abs(1 - 1) + abs(1 - 0) = 1 from your score.
 * Your final score is 12 - 1 = 11.
 *
 *
 *
 * Constraints:
 *
 *
 * m == points.length
 * n == points[r].length
 * 1 <= m, n <= 10^5
 * 1 <= m * n <= 10^5
 * 0 <= points[r][c] <= 10^5
 *
 *
 */
#include <bits/stdc++.h>
using namespace std;
// @lc code=start
class Solution
{
public:
    long long maxPoints(vector<vector<int>> &points)
    {
        const size_t m = points.size();
        const size_t n = (m == 0 ? 0 : points[0].size());

        // dp[i][j] marks the max points we can get if we select points[i][j]
        vector<vector<long long>> dp(m, vector<long long>(n, 0));
        // Initialize the first row
        for (size_t j = 0; j < n; j++)
            dp[0][j] = (long long)points[0][j];

        for (size_t i = 1; i < m; i++)
        {
            // Create and populate left_max and right_max arrays
            vector<long long> left_max(n, LONG_LONG_MIN);
            vector<long long> right_max(n, LONG_LONG_MIN);

            // Calculate left_max array
            left_max[0] = dp[i - 1][0];
            for (size_t j = 1; j < n; j++)
            {
                left_max[j] = max(left_max[j - 1], dp[i - 1][j] + (long long)j);
            }

            // Calculate right_max array
            right_max[n - 1] = dp[i - 1][n - 1] - (n - 1);
            for (int j = n - 2; j >= 0; j--)
            {
                right_max[j] = max(right_max[j + 1], dp[i - 1][j] - (long long)j);
            }

            // Fill the dp array for the current row
            for (size_t j = 0; j < n; j++)
            {
                dp[i][j] = max(left_max[j] - j, right_max[j] + j) + (long long)points[i][j];
            }
        }
        long long res = LONG_LONG_MIN;
        for (size_t j = 0; j < n; j++)
            res = max(res, dp[m - 1][j]);
        return res;
    }
};
